class User {
    constructor (name, lastname, age) {
        this.name = name;
        this.lastname = lastname;
        this.age = age;
    }

    description () {
        return "Name: " + this.name + "\nLastName: " + this.lastname + "\nAge: " + this.age;
    } 
}

export default User;
